message:
@nayibbukele em seu discurso para as Forças Armadas que a 8 meses vem enfrentando ferozmente todas as Facções criminosas existentes no país. 

" Nós somos o instrumento para curar está terra, cada um de vocês é um instrumento de Deus para fazer isso, a Paz não é alcançada através de acordos assinados entre corruptos, Compartilhando o poder entre assassinos.
A paz se constrói com muito trabalho, com suor, com esforço, e com a bravura que você e seus irmãos na polícia tem".
